import React from "react";
import "./UserCardList.css";
import { useNavigate } from "react-router-dom";

const UserCardList = (props) => {
  const navigate = useNavigate();
  const { id, name, username, email, address, phone, website, company } =
    props.value;

  const handleclick = () => {
    console.log(id);
    navigate(`/user/${id}`);
  };
  return (
    <>
     <div class="user-card">
  <div class="user-card__header">
    <div class="user-card__avatar">
      <img src="https://via.placeholder.com/150" alt="User Avatar"/>
    </div>
    <div class="user-card__header-info">
      <h2 class="user-card__name">John Doe</h2>
      <h3 class="user-card__username">@johndoe</h3>
      <p class="user-card__bio">Lorem ipsum dolor sit amet, consectetur adipiscing elit. In blandit tellus vitae quam malesuada euismod.</p>
    </div>
  </div>
  <div class="user-card__content">
    <div class="user-card__item">
      <span class="user-card__label">Email:</span>
      <span class="user-card__value">johndoe@gmail.com</span>
    </div>
    <div class="user-card__item">
      <span class="user-card__label">Phone:</span>
      <span class="user-card__value">(123) 456-7890</span>
    </div>
    <div class="user-card__item">
      <span class="user-card__label">Website:</span>
      <span class="user-card__value">johndoe.com</span>
    </div>
    <div class="user-card__item">
      <span class="user-card__label">Company:</span>
      <span class="user-card__value">Acme Inc.</span>
    </div>
  </div>
</div>

    </>
  );
};
export default UserCardList;
